import React, {useEffect,useState}from 'react';
import InventoriesList from './InventoriesList';


function Products() {
  const [Inventories,setIsInventories]=useState([]);


  useEffect(()=>{
    fetch('https://nameless-retreat-54870.herokuapp.com/inventories')
    .then(res=>res.json())
    .then(isInventories=>setIsInventories(isInventories))
  },[])
  return (
    <InventoriesList isInventories={Inventories}/>
  )
}

export default Products
